import { makeStyles } from "@mui/styles"
import { borders } from '@mui/system';


const homeStyles = makeStyles (() =>({
    card:{
        borderRadius: '50px',
        maxWidth: 345,
        background: '#272727',
        color: '#ffffff',
    },
    cardTypography:{
        color:'#ffff',
    }
    }
))

export default homeStyles
